import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

export default function Dashboard() {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const clientId = localStorage.getItem("userId");
  const token = localStorage.getItem("token");

  useEffect(() => {
    if (!clientId || !token) {
      setError("Client not logged in!");
      setLoading(false);
      return;
    }

    const fetchProjects = async () => {
      try {
        const response = await axios.get(
          `http://localhost:8080/projects/client/${clientId}`,
          { headers: { Authorization: `Bearer ${token}` } }
        );
        setProjects(response.data);
      } catch (err) {
        console.error(err.response || err);
        setError("Error fetching projects.");
      } finally {
        setLoading(false);
      }
    };

    fetchProjects();
  }, [clientId, token]);

  const viewProposals = (projectId) => {
    navigate(`/proposals/${projectId}`);
  };

  const viewMoreDetails = (projectId) => {
    navigate(`/milestones/${projectId}`);
  };

  const handleStatusChange = async (projectId, newStatus) => {
    try {
      await axios.put(
        `http://localhost:8080/projects/${projectId}/status`,
        { status: newStatus },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      setProjects((prev) =>
        prev.map((p) =>
          p.id === projectId ? { ...p, status: newStatus } : p
        )
      );
    } catch (err) {
      console.error("Error updating status:", err);
      alert("Failed to update status.");
    }
  };

  const handleDelete = async (projectId) => {
    if (!window.confirm("Are you sure you want to delete this project?")) return;

    try {
      console.log("Deleting project ID:", projectId);

      const response = await axios.delete(
        `http://localhost:8080/projects/delete/${Number(projectId)}`,
        { headers: { Authorization: `Bearer ${token}` } }
      );

      console.log("Delete response:", response.data);

      setProjects((prev) => prev.filter((p) => p.id !== projectId));
      alert("Project deleted successfully!");
    } catch (err) {
      console.error("Error deleting project:");
      if (err.response) {
        console.error("Status:", err.response.status);
        console.error("Data:", err.response.data);
        console.error("Headers:", err.response.headers);
        alert(`Failed to delete project. Server responded with status ${err.response.status}`);
      } else if (err.request) {
        console.error("Request:", err.request);
        alert("Failed to delete project. No response from server.");
      } else {
        console.error("Error message:", err.message);
        alert(`Failed to delete project: ${err.message}`);
      }
    }
  };

  if (loading) return <p>Loading projects...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>Your Posted Projects</h2>
      {projects.length === 0 ? (
        <p>No projects posted yet.</p>
      ) : (
        <ul>
          {projects.map((project) => (
            <li
              key={project.id}
              style={{
                marginBottom: "15px",
                border: "1px solid #ccc",
                padding: "10px",
                borderRadius: "5px",
              }}
            >
              <h3>{project.title}</h3>
              <p><strong>Description:</strong> {project.description}</p>
              <p>
                <strong>Budget:</strong> {project.minBudget} - {project.maxBudget}
              </p>
              <p>
                <strong>Deadline:</strong>{" "}
                {new Date(project.deadline).toLocaleDateString()}
              </p>
              <p>
                <strong>Skills:</strong> {project.skills.join(", ")}
              </p>

              <div>
                <strong>Status:</strong>{" "}
                <select
                  value={project.status}
                  onChange={(e) =>
                    handleStatusChange(project.id, e.target.value)
                  }
                >
                  <option value="OPEN">OPEN</option>
                  <option value="IN_PROGRESS">IN_PROGRESS</option>
                  <option value="CLOSED">CLOSED</option>
                </select>
              </div>

              <div>
                <button
                  onClick={() => viewProposals(project.id)}
                  style={{ marginTop: "10px", padding: "5px 10px", marginRight: "10px" }}
                >
                  View Proposals
                </button>

                <button
                  onClick={() => viewMoreDetails(project.id)}
                  style={{ marginTop: "10px", padding: "5px 10px" }}
                >
                  View More Details
                </button>

                <button
                  onClick={() => handleDelete(project.id)}
                  style={{
                    marginTop: "10px",
                    padding: "5px 10px",
                    marginLeft: "10px",
                    backgroundColor: "red",
                    color: "white",
                  }}
                >
                  Delete
                </button>
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
